import React from "react";
import "./Navbar.css"
const Navbar = (props)=>{
    return (
        <div className="ctn-navbar">
            <img src={"logo.svg"} className='logo-navbar'/>
            <div className="links-ctn">
                <a href="">PROPÓSITO</a>
                <a href="">COMO FUNCIONA</a>
                <a href="" className="yellow-text">CONHEÇA O APP</a>
            </div>
        </div>
    )
}

export default Navbar;
